import store from "@/store";
import Vue from "vue";

/**
 * 自定义指令
 * 第一个参数是指令
 * 第二个参数是实现方法
 */
Vue.directive("hasRole", {
  inserted(el, binding) {
    console.log(el);
    console.log(binding);
    //
  }
})
